class TestBitQueryTronApiCalls(TestCase):
    api = TronFullNodeAPI
    addresses = ['TZC8w4ka7kFNtHRNrzx6CdQ1kDVSqyqmoe']
    blocks = [(65030100, 65030103)]

    @pytest.mark.slow
    def test_get_balance_api(self):
        for address in self.addresses:
            get_balance_result = self.api.get_balance(address)
            assert isinstance(get_balance_result, dict)
            key2check = [('address', str), ('balance', int), ('create_time', int), ('account_resource', dict)]
            for key, value in key2check:
                assert isinstance(get_balance_result.get(key), value)

    @pytest.mark.slow
    def test_get_block_head_api(self):
        get_block_head_result = self.api.get_block_head()
        assert isinstance(get_block_head_result, dict)
        assert isinstance(get_block_head_result.get('block_header'), dict)
        assert isinstance(get_block_head_result.get('block_header').get('raw_data'), dict)
        assert isinstance(get_block_head_result.get('block_header').get('raw_data').get('number'), int)

    @pytest.mark.slow
    def test_get_block_txs_api(self):
        for from_block, to_block in self.blocks:
            get_block_txs_result = self.api.get_batch_block_txs(from_block, to_block)
            assert isinstance(get_block_txs_result, dict)
            assert isinstance(get_block_txs_result.get('block'), list)
            for block in get_block_txs_result.get('block'):
                assert isinstance(block.get('transactions'), list)
                assert isinstance(block.get('block_header'), dict)
                assert isinstance(block.get('block_header').get('raw_data'), dict)
                assert isinstance(block.get('block_header').get('raw_data').get('number'), int)
                key2check_tx = [('ret', list), ('signature', list), ('txID', str), ('raw_data', dict)]
                for tx in block.get('transactions'):
                    for key, value in key2check_tx:
                        assert isinstance(tx.get(key), value)

    @pytest.mark.slow
    def test_get_token_balance_api(self):
        contract_info = TRC20_contract_info.get('mainnet').get(Currencies.usdt)
        for address in self.addresses:
            token_balance_result = self.api().get_token_balance('TQ1CTtGWJccsVeDgLjj2a1G9kdLYAeLqBN', contract_info)
            assert isinstance(token_balance_result, dict)
            assert isinstance(token_balance_result.get('constant_result'), list)
            assert isinstance(token_balance_result.get('constant_result')[0], str)
            assert isinstance(token_balance_result.get('result'), dict)
            assert isinstance(token_balance_result.get('result').get('result'), bool)


