            {'address': 'TZC8w4ka7kFNtHRNrzx6CdQ1kDVSqyqmoe', 'balance': 76579205, 'create_time': 1724403708000,
             'latest_opration_time': 1725778614000, 'free_net_usage': 182, 'latest_consume_free_time': 1725739491000,
             'net_window_size': 28800000, 'net_window_optimized': True,
             'account_resource': {'latest_consume_time_for_energy': 1725778614000, 'energy_window_size': 28800000,
                                  'energy_window_optimized': True},
             'owner_permission': {'permission_name': 'owner', 'threshold': 1,
                                  'keys': [{'address': 'TZC8w4ka7kFNtHRNrzx6CdQ1kDVSqyqmoe', 'weight': 1}]},
             'active_permission': [{'type': 'Active', 'id': 2, 'permission_name': 'active', 'threshold': 1,
                                    'operations': '7fff1fc0033ec30f000000000000000000000000000000000000000000000000',
                                    'keys': [{'address': 'TZC8w4ka7kFNtHRNrzx6CdQ1kDVSqyqmoe', 'weight': 1}]}],
             'frozenV2': [{}, {'type': 'ENERGY'}, {'type': 'TRON_POWER'}],
             'assetV2': [{'key': '1005027', 'value': 8888880000}, {'key': '1005026', 'value': 8888880000},
                         {'key': '1005002', 'value': 20000000}],
             'free_asset_net_usageV2': [{'key': '1005002', 'value': 0}, {'key': '1005027', 'value': 0},
                                        {'key': '1005026', 'value': 0}], 'asset_optimized': True}
