        self.explorer.balance_apis[0] = self.api
        self.api.get_balance = Mock(side_effect=balance_mock_response)
        balance_response = self.explorer().get_balance('TZC8w4ka7kFNtHRNrzx6CdQ1kDVSqyqmoe')
